import React from 'react';

function Nav() {
    return(
        <header>
            <h1>
                <a href='/'>Peter Stenger</a>
            </h1>
            <nav>
                <ul className="flex-row">
                    <li></li>
                </ul>
            </nav>
        </header>
    )
}

export default Nav;
